int	p2_lookup[GENOME_SIZE_HW];

unsigned long int next = 1;
 
void my_srand(int x)
{
	next = x;
}
 
int my_rand(void) // RAND_MAX assumed to be 32767
{
    next = next * 1103515245 + 12345;
    return (unsigned int)(next/65536) % 32768;
}


/*---------------------------------------------------------------------------------------------
 * (function: xover_pmx)
 * Goldberg 1985 "Alleles, loci, and the Travelling saleman problem"
 *-------------------------------------------------------------------------------------------*/
void xover_pmx_hw(int toggle_idx, int gp1, int gp2, int gc1, int gc2, int genome_size)
{
	int i, j;
	int temp;
	int swap_idx;

    /* cut point 1 needs to be in the first half */
    int cut_point1 = my_rand() % (genome_size/2);
    int cut_point2 = cut_point1 + (genome_size/2);

	for (i = 0; i < genome_size; i++)
	{
		if (i > cut_point1 || i < cut_point2)
        {
			list_of_idx_to_gene_spots_to_keep[i] = TRUE;
            //genome_c1[i] = genome_p1[i];
            ga_hw_data.population[toggle_idx][gc1][i] = ga_hw_data.population[toggle_idx][gp1][i]; 
            //genome_c2[i] = genome_p2[i];
            ga_hw_data.population[toggle_idx][gc2][i] = ga_hw_data.population[toggle_idx][gp2][i]; 
        }
		else
			list_of_idx_to_gene_spots_to_keep[i] = FALSE;
	}

	/* create the reverse lookup...as in if i want to know where city 3 is in genome p1 I can write p1_lookup[3] */
	for (j = 0; j < genome_size; j++)
	{
		//p1_lookup[genome_p1[j]] = j;
        p1_lookup[ga_hw_data.population[toggle_idx][gp1][j]] = j;
		//p2_lookup[genome_p2[j]] = j;
        p2_lookup[ga_hw_data.population[toggle_idx][gp2][j]] = j;
	}

	/* now copy over the parents details with a remapping for overlaps */
	for (j = 0; j < genome_size; j++)
	{
		/* copy c1 from p2 */
		if (list_of_idx_to_gene_spots_to_keep[j] == FALSE)
		{
			//int genome_id_for_here = genome_p2[j];
			int genome_id_for_here = ga_hw_data.population[toggle_idx][gp2][j];
			/* If this is not true then get from parent2 */
			while (list_of_idx_to_gene_spots_to_keep[p1_lookup[genome_id_for_here]] == TRUE)
			{
				//genome_id_for_here = genome_p2[p1_lookup[genome_id_for_here]];
				genome_id_for_here = ga_hw_data.population[toggle_idx][gp2][p1_lookup[genome_id_for_here]];
			}
			//genome_c1[j] = genome_id_for_here;
			ga_hw_data.population[toggle_idx][gc1][j] = genome_id_for_here;
		}

		/* copy c2 from p1 */
		if (list_of_idx_to_gene_spots_to_keep[j] == FALSE)
		{
			//int genome_id_for_here = genome_p1[j];
			int genome_id_for_here = ga_hw_data.population[toggle_idx][gp1][j];
			/* If this is not true then get from parent2 */
			while (list_of_idx_to_gene_spots_to_keep[p2_lookup[genome_id_for_here]] == TRUE)
			{
				//genome_id_for_here = genome_p1[p2_lookup[genome_id_for_here]];
				genome_id_for_here = ga_hw_data.population[toggle_idx][gp1][p2_lookup[genome_id_for_here]];
			}
			//genome_c2[j] = genome_id_for_here;
			ga_hw_data.population[toggle_idx][gc2][j] = genome_id_for_here;
		}
	}
}

/*---------------------------------------------------------------------------------------------
 * (function: selector_random)
 *-------------------------------------------------------------------------------------------*/
int selector_random_hw()
{
    return my_rand() % ga_hw_data.num_population;
}

/*---------------------------------------------------------------------------------------------
 * (function: tsp_cost_function)
 *-------------------------------------------------------------------------------------------*/
int tsp_cost_function_from_adjacency_hw(int pop_idx, int toggle_idx)
{
	int i;
	int cost = 0;

	for (i = 1; i < GENOME_SIZE_HW; i++)
	{
		cost += adjacency.adjacency_matrix[ga_hw_data.population[toggle_idx][pop_idx][i]][ga_hw_data.population[toggle_idx][pop_idx][i-1]];
	}

	return cost;
}

int temp_pop[GENOME_SIZE_HW];
/*---------------------------------------------------------------------------------------------
void tsp_copy_genome_from_hw(int toggle_idx, int pop_idx)
 *-------------------------------------------------------------------------------------------*/
void tsp_copy_genome_from_hw(int toggle_idx, int pop_idx)
{
	int i; 

	for (i = 0; i < GENOME_SIZE_HW; i++)
	{
		temp_pop[i] = ga_hw_data.population[toggle_idx][pop_idx][i];
	}
}
/*---------------------------------------------------------------------------------------------
void tsp_copy_genome_to_hw(int toggle_idx, int pop_idx)
 *-------------------------------------------------------------------------------------------*/
void tsp_copy_genome_to_hw(int toggle_idx, int pop_idx)
{
	int i; 

	for (i = 0; i < GENOME_SIZE_HW; i++)
	{
		ga_hw_data.population[toggle_idx][pop_idx][i] = temp_pop[i];
	}
}
/*---------------------------------------------------------------------------------------------
void tsp_copy_genome_to_hw(int toggle_idx, int pop_idx)
 *-------------------------------------------------------------------------------------------*/
void tsp_copy_genomes_in_hw(int toggle_idx, int pop_idx_from, int pop_idx_to)
{
	int i; 

	for (i = 0; i < GENOME_SIZE_HW; i++)
	{
		ga_hw_data.population[toggle_idx][pop_idx_to][i] = ga_hw_data.population[toggle_idx][pop_idx_from][i];
	}
}

/*---------------------------------------------------------------------------------------------
 * (function: tsp_cost_function_and_order_hw)
 *-------------------------------------------------------------------------------------------*/
void tsp_cost_function_and_order_hw(int toggle_idx)
{
	int i, j;
	int index_of_lowest_cost;

	for (i = 0; i < ga_hw_data.num_population; i++)
	{
		ga_hw_data.costs[i] = tsp_cost_function_from_adjacency_hw(i, toggle_idx);
	}

	/* Sort the list of populations */
	for (i = 0; i < ga_hw_data.num_population - 1; i++)
	{
		index_of_lowest_cost = i;
		int temp_cost;	
		for (j = i + 1; j < ga_hw_data.num_population; j ++)
		{
			if (ga_hw_data.costs[index_of_lowest_cost] > ga_hw_data.costs[j])
				index_of_lowest_cost = j;
		}

	    /* swap the top with new low */
        tsp_copy_genome_from_hw(global_index, i);
		temp_cost = ga_hw_data.costs[i];

		tsp_copy_genomes_in_hw(global_index, index_of_lowest_cost, i);
        ga_hw_data.costs[i] = ga_hw_data.costs[index_of_lowest_cost];

        tsp_copy_genome_to_hw(global_index, index_of_lowest_cost);
		ga_hw_data.costs[index_of_lowest_cost] = temp_cost;
	}

	printf("Best solution costs: %d\n", ga_hw_data.costs[0]);
	global_best_hw = ga_hw_data.costs[0];
}

/*---------------------------------------------------------------------------------------------
 * (function: tsp_copy_old_genomes)
 *-------------------------------------------------------------------------------------------*/
void tsp_copy_old_genomes_hw(int from_idx, int to_idx, int start, int end)
{
	int i;

	for (i = start; i < end; i++)
	{
		tsp_copy_solution_hw(from_idx, to_idx, i);
	}
}

/*---------------------------------------------------------------------------------------------
 * (function: tsp_copy_solution)
 *-------------------------------------------------------------------------------------------*/
void tsp_copy_solution_hw(int from_idx, int to_idx, int idx)
{
	int i;

	for (i = 0; i < GENOME_SIZE_HW; i++)
	{
		ga_hw_data.population[to_idx][idx][i] = ga_hw_data.population[from_idx][idx][i];
	}
}

/*---------------------------------------------------------------------------------------------
 * (function: tsp_copy_one_solution_hw)
 *-------------------------------------------------------------------------------------------*/
void tsp_copy_one_solution_hw(int from_idx, int f_idx, int to_idx, int t_idx)
{
	int i;

	for (i = 0; i < GENOME_SIZE_HW; i++)
	{
		ga_hw_data.population[to_idx][t_idx][i] = ga_hw_data.population[from_idx][f_idx][i];
	}
}
/*---------------------------------------------------------------------------------------------
 * (function: tsp_cross_breed)
 *-------------------------------------------------------------------------------------------*/
void tsp_cross_breed_hw(int toggle_idx, int start, int end)
{
	int i, j;
	int parent1;
	int parent2;
	int temp;
	int *genome_p1;
	int *genome_p2;
	int *genome_c1;
	int *genome_c2;

	if (start == end)
		return;


	int temp_end = end-(end - start)%2; // make sure even number
	for (i = start; i < temp_end; i += 2)
	{
        /* pick up 2 parents */
        parent1 = selector_random_hw();
        parent2 = selector_random_hw();

		if (parent1 == parent2)
		{
			/* if two random numbers are the same */
			parent2 = (parent2 != ga_hw_data.num_population-1) ? parent2 + 1 : parent2 - 1;
		}

        xover_pmx_hw(toggle_idx, parent1, parent2, i, i+1, GENOME_SIZE_HW);
	}
}

/*---------------------------------------------------------------------------------------------
 * (function: tsp_mutate)
 *-------------------------------------------------------------------------------------------*/
void tsp_mutate_hw(int toggle_idx, int start, int end, int from_best)
{
	int i, j;
	int who;
	int num_mutations = ga_hw_data.num_mutations;
	int swap_g1, swap_g2;
	int temp;

	for (i = start; i < end; i++)
	{
		/* find out who is the parent, copy over to "to" */
		who = my_rand() % from_best;
		tsp_copy_one_solution_hw(toggle_idx, who, global_index, i);

		/* mutate the copied genome */ 
		for (j = 0; j < num_mutations; j++)
		{
			swap_g1 = my_rand() % GENOME_SIZE_HW;
			swap_g2 = my_rand() % GENOME_SIZE_HW;
			temp = ga_hw_data.population[toggle_idx][i][swap_g1];
			ga_hw_data.population[toggle_idx][i][swap_g1] = ga_hw_data.population[toggle_idx][i][swap_g2];
			ga_hw_data.population[toggle_idx][i][swap_g2] = temp;
		}
	}
}

/*---------------------------------------------------------------------------------------------
 * (function: tsp_breed_and_mutate)
 *-------------------------------------------------------------------------------------------*/
void tsp_breed_and_mutate_hw( int toggle_idx, int start, int end)
{
	int i, j;
	int num_mutations = ga_hw_data.num_mutations;
	int swap_g1, swap_g2;
	int temp;

	/* do the cross breeding */
	tsp_cross_breed_hw(toggle_idx, start, end);

	/* mutate */
	for (i = start; i < end; i++)
	{
		/* mutate the copied genome */ 
		for (j = 0; j < num_mutations; j++)
		{
			swap_g1 = my_rand() % GENOME_SIZE_HW;
			swap_g2 = my_rand() % GENOME_SIZE_HW;
			temp = ga_hw_data.population[toggle_idx][i][swap_g1];
			ga_hw_data.population[toggle_idx][i][swap_g1] = ga_hw_data.population[toggle_idx][i][swap_g2];
			ga_hw_data.population[toggle_idx][i][swap_g2] = temp;
		}
	}
}

/*---------------------------------------------------------------------------------------------
 * (function: tsp_random_new)
 *-------------------------------------------------------------------------------------------*/
void tsp_random_new_hw(int toggle_idx, int start, int end)
{
	int i, j;
	/* do num cities */
	int num_swaps;
	int temp;
	num_swaps = GENOME_SIZE_HW * 2;

	for (i = start; i < end; i++)
	{
		for (j = 0; j < num_swaps; j++)
		{
			int swap1 = my_rand()%GENOME_SIZE_HW;
			int swap2 = my_rand()%GENOME_SIZE_HW;
	
			temp = ga_hw_data.population[toggle_idx][i][swap1];
			ga_hw_data.population[toggle_idx][i][swap1] = ga_hw_data.population[toggle_idx][i][swap2];
			ga_hw_data.population[toggle_idx][i][swap2] = temp;
		}
	}

}

/*---------------------------------------------------------------------------------------------
 * (function: tsp_exit_condition)
 *-------------------------------------------------------------------------------------------*/
short tsp_exit_condition_hw()
{
	static int breeding_cycles = 0;
	static int count = 0;
	static int recuring_best = 0;

	breeding_cycles ++;
	printf("breed cycle: %d\n", breeding_cycles);

#if 0
	if (breeding_cycles == 1000)
	{
		breeding_cycles = 0;
		return TRUE; // exit
	}
	else
	{
		return FALSE;
	}
#endif 

	if (global_best_hw <= recuring_best)
	{
		recuring_best = global_best_hw;
		count = 0;
	}
	else
	{
		count ++;
	}

	if (count > 500)
	{
		count = 0;
		breeding_cycles = 0;
		return TRUE; // exit
	}
	else
	{
		return FALSE;
	}
}
/*---------------------------------------------------------------------------------------------
 * (function: run_ga)
 *-------------------------------------------------------------------------------------------*/
void run_base_ga_hw()
{
	short exit = FALSE;
	short to_pop_idx;

	global_index = 0;

	/* calculate indexes for new population */
    printf("idx_start_keep = %d\n", ga_hw_data.idx_start_keep);
    printf("idx_end_keep  = %d\n", ga_hw_data.idx_end_keep );
    printf("idx_start_mutate = %d\n", ga_hw_data.idx_start_mutate);
    printf("idx_end_mutate = %d\n", ga_hw_data.idx_end_mutate);
    printf("idx_start_breed = %d\n", ga_hw_data.idx_start_breed);
    printf("idx_end_breed = %d\n", ga_hw_data.idx_end_breed);
    printf("idx_start_breed_and_mutate = %d\n", ga_hw_data.idx_start_breed_and_mutate);
    printf("idx_end_breed_and_mutate = %d\n", ga_hw_data.idx_end_breed_and_mutate);
    printf("idx_start_random = %d\n", ga_hw_data.idx_start_random);
    printf("idx_end_random = %d\n", ga_hw_data.idx_end_random);
    printf("idx_end_breed_from  = %d\n", ga_hw_data.idx_end_breed_from );
    printf("idx_end_mutate_from = %d\n", ga_hw_data.idx_end_mutate_from);
    printf("idx_end_breed_mutate_from = %d\n", ga_hw_data.idx_end_breed_mutate_from);

	while (exit == FALSE)
	{
		to_pop_idx = (global_index+1)%2;

		/* EVALUATE POPULATION AND ORDER */
        tsp_cost_function_and_order_hw(global_index);

		/* KEEP OLD */
        tsp_copy_old_genomes_hw(global_index, to_pop_idx, ga_hw_data.idx_start_keep, ga_hw_data.idx_end_keep);
	
		/* CROSSBREED NEW */
        tsp_cross_breed_hw(to_pop_idx, ga_hw_data.idx_start_breed, ga_hw_data.idx_end_breed);
	
		/* MUTATE NEW */
        tsp_mutate_hw(to_pop_idx, ga_hw_data.idx_start_mutate, ga_hw_data.idx_end_mutate, ga_hw_data.idx_end_mutate_from);

		/* CROSSBREED & MUTATE NEW */
        tsp_breed_and_mutate_hw(to_pop_idx, ga_hw_data.idx_start_breed_and_mutate, ga_hw_data.idx_end_breed_and_mutate);
	
		/* CREATE RANDOM NEW */
        tsp_random_new_hw(to_pop_idx, ga_hw_data.idx_start_random, ga_hw_data.idx_end_random);

		/* CHECK EXIT CONDITION */
        exit = tsp_exit_condition_hw();

		/* swap to the new population */
		global_index = to_pop_idx;
	}
}

int main(void) 
{
	int ret_Val = 0;

        /* call the run of the ga */
	my_srand(ga_hw_data.rand_seed);

        run_base_ga_hw();

	printf("Result: %d\n", ret_Val);
	if (ret_Val == 0) {
		printf("RESULT: PASS\n");
	} else {
		printf("RESULT: FAIL\n");
	}

	return ret_Val;

}


